	{
		// generate, check and stream operators
		std::cout << "TMCG_SecretKey(), TMCG_PublicKey(), *.check(), <<" <<
			std::endl;
		TMCG_SecretKey sec("Alice", "alice@gaos.org", TMCG_QRA_SIZE);
		TMCG_SecretKey sec3("Bob", "bob@gaos.org", TMCG_QRA_SIZE, false);
		TMCG_SecretKey sec4("Carol", "carol@gaos.org", 2 * TMCG_QRA_SIZE);
		TMCG_PublicKey pub(sec), pub3(sec3), pub4(sec4);
		std::cout << sec << std::endl;
		std::cout << pub << std::endl;
		assert(sec.check());
		assert(pub.check());
		std::cout << sec3 << std::endl;
		std::cout << pub3 << std::endl;
		assert(sec3.check());
		assert(pub3.check());
		std::cout << sec4 << std::endl;
		std::cout << pub4 << std::endl;
		assert(sec4.check());
		assert(pub4.check());
	
		// fingerprint
		std::cout << sec.fingerprint() << std::endl << std::endl;
		std::cout << pub.fingerprint() << std::endl << std::endl;
		assert(sec.fingerprint() == pub.fingerprint());
		std::cout << sec3.fingerprint() << std::endl << std::endl;
		std::cout << pub3.fingerprint() << std::endl << std::endl;
		assert(sec3.fingerprint() == pub3.fingerprint());
		assert(sec.fingerprint() != sec3.fingerprint());
		std::cout << sec4.fingerprint() << std::endl << std::endl;
		std::cout << pub4.fingerprint() << std::endl << std::endl;
		assert(sec4.fingerprint() == pub4.fingerprint());
		assert(sec.fingerprint() != sec4.fingerprint());
	
		// sign and verify the same message
		std::cout << "TMCG_SecretKey.sign(), *.verify() with the same" <<
			" message and N = " << N << std::endl;
		std::string v = "To be signed ...", vf = "Not valid!";
		for (size_t i = 0; i < N; i++)
		{
			std::string sig = sec.sign(v);
			assert(sec.verify(v, sig));
			assert(pub.verify(v, sig));
			assert(!sec.verify(vf, sig));
			assert(!pub.verify(vf, sig));
			std::string sig3 = sec3.sign(v);
			assert(sec3.verify(v, sig3));
			assert(pub3.verify(v, sig3));
			assert(!sec.verify(v, sig3));
			assert(!pub.verify(v, sig3));
			assert(!sec3.verify(vf, sig3));
			assert(!pub3.verify(vf, sig3));
			std::string sig4 = sec4.sign(v);
			assert(sec4.verify(v, sig4));
			assert(pub4.verify(v, sig4));
			assert(!sec.verify(v, sig4));
			assert(!pub.verify(v, sig4));
			assert(!sec4.verify(vf, sig4));
			assert(!pub4.verify(vf, sig4));
		}

		// sign and verify different messages
		std::cout << "TMCG_SecretKey.sign(), *.verify() with different" <<
			" messages and N = " << N << std::endl;
		for (size_t i = 0; i < N; i++)
		{
			std::stringstream var;
			var << "VarMessage " << N;
			std::string sig = sec.sign(var.str());
			assert(sec.verify(var.str(), sig));
			assert(pub.verify(var.str(), sig));
			std::string sig3 = sec3.sign(var.str());
			assert(sec3.verify(var.str(), sig3));
			assert(pub3.verify(var.str(), sig3));
			std::string sig4 = sec4.sign(var.str());
			assert(sec4.verify(var.str(), sig4));
			assert(pub4.verify(var.str(), sig4));
		}
	
		// encrypt and decrypt
		std::cout << "*.encrypt(), TMCG_SecretKey.decrypt()" << std::endl;
		unsigned char tmp[TMCG_SAEP_S0], dec[TMCG_SAEP_S0], dec2[TMCG_SAEP_S0];
		gcry_randomize(tmp, sizeof(tmp), GCRY_STRONG_RANDOM);
		std::string enc = pub.encrypt(tmp);
		std::string enc2 = sec.encrypt(tmp);
		assert(sec.decrypt(dec, enc));
		assert(!memcmp(tmp, dec, TMCG_SAEP_S0));
		assert(sec.decrypt(dec2, enc2));
		assert(!memcmp(tmp, dec2, TMCG_SAEP_S0));
		enc = pub3.encrypt(tmp);
		enc2 = sec3.encrypt(tmp);
		assert(sec3.decrypt(dec, enc));
		assert(!memcmp(tmp, dec, TMCG_SAEP_S0));
		assert(sec3.decrypt(dec2, enc2));
		assert(!memcmp(tmp, dec2, TMCG_SAEP_S0));
		enc = pub4.encrypt(tmp);
		enc2 = sec4.encrypt(tmp);
		assert(sec4.decrypt(dec, enc));
		assert(!memcmp(tmp, dec, TMCG_SAEP_S0));
		assert(sec4.decrypt(dec2, enc2));
		assert(!memcmp(tmp, dec2, TMCG_SAEP_S0));

		// import a fixed key and verify a fixed signature
		TMCG_SecretKey sec2;
		TMCG_PublicKey pub2;
		std::cout << "*.import(), *.verify()" << std::endl;
		assert(sec2.import(ks));
		assert(pub2.import(kp));
		assert(sec2.check());
		assert(pub2.check());
		std::cout << sec2.sign(v) << std::endl;
		assert(sec2.verify(v, vsig));
		assert(pub2.verify(v, vsig));
		assert(!sec2.verify(vf, vsig));
		assert(!pub2.verify(vf, vsig));	
	
		return 0;
	}
	catch (std::exception& e)
	{
		std::cerr << "exception catched with what = " << e.what() << std::endl;
		return -1;
	}
